import React from 'react'
import './home.css'
import video from '../../Assets/video.mp4'

const Home = () => {
  return (
    <section className = 'home'>
      <div className = "overlay"></div>
      <video src  = {video} type ="video/mp4"></video>

    </section>

  )
}

export default Home
